script: |
  super -f text -I q4264.spq | sort > q4264.out

inputs:
  - name: q4264.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) cor0 WHERE ( col2 ) * col1 - + + col0 + - - col1 NOT IN ( - 49, 6 + - 44, - 85 * col2 + + col0 );
  - name: tab1

outputs:
  - name: q4264.out
    data: |
      51	14	96
      85	5	59
      91	47	68
